import React from 'react'

import { Card } from 'semantic-ui-react'
import '../stylesheets/PokeStats.css'


class Profile extends React.Component {
	render() {

		return (
			<Card className='pokeCard'>
				<div>
				hey there
				</div>
			</Card>
		)
	}
}
export default Profile
